script: |
  super -f text -I q951.spq | sort > q951.out

inputs:
  - name: q951.spq
    data: |
      SELECT - 16 + - COUNT ( * ) AS col2, COUNT ( * ) / + + ( - 58 ) + - CASE 6 WHEN + 36 THEN NULL WHEN + 93 * 86 THEN NULL ELSE COUNT ( * ) - ( - 14 ) / + ( - 78 * 26 ) END AS col1;

outputs:
  - name: q951.out
    data: |
      -17	-1
